import React from "react";
import NavBar from "./NavBar";

const Chats = () => {
  return (
    <div className="">
      <NavBar />
      <div className="p-16 text-white  ">
       <h2 className="text-3xl">Chat with your Freinds</h2>
       <div className="flex mt-10 p-5">
           <input placeholder="Message" className="w-72 border-2 border-zinc-400  p-3 bg-black rounded-lg"></input>
           <button className="bg-yell pl-2 pr-2 rounded-full ">Send</button>
       </div>
    </div>
    </div>
  );
};

export default Chats;
